+ (NSDictionary *)DictFromStr:(NSString *)string {
    NSData  *data   =   [string dataUsingEncoding:NSUTF8StringEncoding];
    NSDictionary *dict  =   [NSJSONSerialization JSONObjectWithData:data options:NSJSONReadingMutableLeaves error:nil];
    return dict;
}

+ (NSArray *)getCitiesFromProId:(NSString *)proid {
    NSMutableArray *cityArr =   [NSMutableArray array];
    NSArray *array  =   [self shareCity];
    for (NSDictionary *dict in array) {
        if ([dict[@"provinceId"] isEqualToString:proid]) {
            [cityArr addObject:dict];
        }
    }
    return cityArr;
}
+ (NSArray *)getAreasFromCityId:(NSString *)cityid {
    NSMutableArray *areaArr =   [NSMutableArray array];
    NSArray *array  =   [self shareArea];
    for (NSDictionary *dict in array) {
        if ([dict[@"cityId"] isEqualToString:cityid]) {
            [areaArr addObject:dict];
        }
    }
    return areaArr;
}
